import React from 'react'
import '../App/App.css';
import {SidebarData} from '../Sidebar/SidebarData';
import Banner from '../Banner/Banner';
import Body from '../Body/Body';

class SideProject extends React.Component{
    render(){
        let item = SidebarData.find(item => item.title === "Side Projects");
        return(
            <div className='pages'>
                <Banner 
                imageSrc = {item.imgSrc}
                thisIs = "My Side Project"
                descript= "This is a budding collection of side projects and experiments that I dabble in for fun in and outside of school!!!!!!!!!!!!!!!"
                />
                <Body 
                title = 'Remote Soil Monitoring Robot'
                dashColor = "#4B6CF8"
                hasDash = "â€”"
                intro = "I am a recent UC Irvine grad with a B.S. in Computer Science & Engineering (porque no los dos, right?). During my years in college and through my internships, I have come to love designing and front-end development. I am always looking for all sorts of technical roles because I am firm believer of the saying, 'Don't knock it till you try it!'"
                />
            </div>
        )
    }
}

export default SideProject;
